import React from "react";
import "./Glowna.css";
import Slider from "../Slider/Slider";
import Para from "../UI/Para";

export default function Glowna() {
  return (
    <div>
      <div className="main">
        <Slider />
        <Para>
          Biuro rachunkowe BALANS powstało z myślą o ludziach, którzy potrzebują
          pomocy i wsparcia w gąszczu wielu niezrozumiałych przepisów. Nasze
          biuro powstało, by wesprzeć w opracowaniu dokumentacji kadrowej,
          płacowej i wielu innych obowiązkach, jakie ciążą na pracodawcach i ich
          przedsiębiorstwach.
        </Para>
      </div>
    </div>
  );
}
